import React from 'react';
import { View, Text, Button } from 'react-native-web';


function MainUnauthScreen({ navigation }) {
const styles = useStyles();
  return (
    <View style={styles.container}>
    <Text>Ghb</Text>
  </View>
  );
}

export default MainUnauthScreen;
